  const goToMap = () => {
    navigate('/map');
  };

  const goToListing = () => {
    navigate('/listing');
  };

  const goHome = () => {
    navigate('/home');
  };

    return(
        <>
        <div className="stars"></div>
    <nav className="navbar">
    <a className="logo-container" onClick={goHome}>  
                    <img className="cow" src={logo} alt="logo"/>
                        <span className="logo-text text">AlienExpress</span>
                </a>
